    var c1_s= create3(size, s1.rows, s1.cols, s1.boxs, s1.qubs)

    // console.log(rows, cols, boxs, qubs)
    
    return (
        <div>
            { c1_s.rows.length &&
            <Two rows={c1_s.rows} sizing={size} cols={c1_s.cols} qubs={c1_s.qubs} boxs={c1_s.boxs}/>
            }
        </div>
    )
}
